	static void solve() throws Exception{
		int n = sc.nextInt(), arr[] = new int[n];

		for(int i = 0; i < n; i++) {
			arr[i] = sc.nextInt();
		}

		int one = 0, zero = 0;
		for(int bit = 30; bit >= 0; bit--) {
			one = zero = 0;

			for(int i = 0; i < n; i++) {
				if((arr[i] & (1 << bit)) != 0) one++;
				else zero++;
			}

			if(one % 2 != 0) break;
		}

		if(one % 2 == 0) {
			out.println("DRAW");
			return;
		}

		if(one % 4 == 1) {
			out.println("WIN");
			return;
		}

		out.println(zero % 2 == 0 ? "LOSE" : "WIN");

	}

	public static void main(String[] args) throws Exception {
		int t = sc.nextInt();
		while(t-- > 0) {
			solve();
		}
		out.close();
	}
}

