const int L = 30;
int N, T;
int freq[L + 1];
void solve() {
  scanf("%d", &N);
  memset(freq, 0, sizeof(freq));
  for (int i = 0, x; i < N; i++) {
    scanf("%d", &x);
    for (int j = 0; j <= L; j++) {
      freq[j] += (x >> j) & 1;
    }
  }
  for (int i = L; i >= 0; i--) {
    if (freq[i] % 2) {
      int win = freq[i] % 4 == 1 || (N - freq[i]) % 2 == 1;
      puts(win ? "WIN" : "LOSE");
      return;
    }
  }
  puts("DRAW");
}
int main() {
  scanf("%d", &T);
  for (int test = 0; test < T; test++) {
    solve();
  }
}

