        }
        int xor = 0;
        for(int i=0;i<n;i++) xor^=arr[i];
        int pos = 30;
        while(pos>=0&&((xor|(1<<pos))!=xor)){
            pos--;
        }
        if(pos<0){
            out.println("DRAW");
            return;
        }
        int cnt = 0;
        for(int i=0;i<n;i++){
            if((arr[i]|(1<<pos))==arr[i]){
                cnt++;
            }
        }
        if(cnt%4==1){
            out.println("WIN");
        }else if(cnt%4==3&&(n-3)%2==0){
            out.println("LOSE");
        }else{
            out.println("WIN");
        }


